import "./nav.css";
import { Link } from "react-router-dom";
import homeImg from "../assests/PORTFOLIO..svg";

export default function NavBar() {
  return (
    <div>
      <div className="navBox">
        <Link to="/">
          <img src={homeImg} alt="homImg" className="homeImg" />
        </Link>
        <ul type="none" className="liBox">
          <li>ABOUT</li>
          <li>GOAL</li>
          <li>CONTACT</li>
        </ul>
      </div>
    </div>
  );
}
